import React, { Component } from 'react';


class Home extends Component {
    render() {
        return (
            <div>
                <h1 className='title'>Welcome to Family Archive!</h1>
                <p>This is a site where you are able to organize your personal archives</p>
                <br></br>
            </div>
        )
    }
}


export default Home
